import{_ as e,o as t,c as a,O as n}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 17.1-205.1 Sealing Fee Fund.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/17.1-205.1.md","filePath":"vacode/17.1-205.1.md"}'),r={name:"vacode/17.1-205.1.md"},o=n('<h1 id="§-17-1-205-1-sealing-fee-fund" tabindex="-1">§ 17.1-205.1 Sealing Fee Fund. <a class="header-anchor" href="#§-17-1-205-1-sealing-fee-fund" aria-label="Permalink to &quot;§ 17.1-205.1 Sealing Fee Fund.&quot;">​</a></h1><p>There is hereby created in the state treasury a special nonreverting fund to be known as the Sealing Fee Fund, referred to in this section as &quot;the Fund.&quot; The Fund shall be established on the books of the Comptroller. All funds accruing to the Fund pursuant to §§ <a href="/vacode/19.2-392.12/">19.2-392.12</a> and <a href="/vacode/19.2-392.16/">19.2-392.16</a> and all funds appropriated for such purpose and any gifts, donations, grants, bequests, and other funds received on its behalf shall be paid into the state treasury and credited to the Fund. Interest earned on moneys in the Fund shall remain in the Fund and be credited to it. Any moneys remaining in the Fund, including interest thereon, at the end of each fiscal year shall not revert to the general fund but shall remain in the Fund. The Fund shall be administered by the Executive Secretary of the Supreme Court, who shall use such funds solely to fund the costs for the compensation of court-appointed counsel under the provisions of subsection L of § <a href="/vacode/19.2-392.12/">19.2-392.12</a>. Expenditures from the Fund shall be limited by an appropriation in the general appropriation act. Expenditures and disbursements from the Fund shall be made by the State Treasurer on warrants issued by the Comptroller upon request of the Executive Secretary of the Supreme Court.</p><p>2021, Sp. Sess. I, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0524" target="_blank" rel="noreferrer">524</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0542" target="_blank" rel="noreferrer">542</a>.</p>',3),s=[o];function i(d,h,l,u,c,f){return t(),a("div",null,s)}const m=e(r,[["render",i]]);export{_ as __pageData,m as default};
